class FixedPointTheorem:
    def cycleRange(self, R):
        X = 0.25;
        for i in range(200000) :
        	X = R * X * ( 1 - X);
        X1 = 1000;
        X2 = -1000;
        for i in range(1000) :
        	X = R * X * (1 - X);
        	X1 = min(X1, X);
        	X2 = max(X2, X);
        
        return X2 - X1;

